$(function() {
    $('.jQueryMask-date').mask('00/00/0000');
    $('.jQueryMask-time').mask('00:00:00');
    $('.jQueryMask-date_time').mask('00/00/0000 00:00:00');
    $('.jQueryMask-cep').mask('00000-000');
    $('.jQueryMask-phone').mask('0000-0000');
    $('.jQueryMask-phone_with_ddd').mask('(00) 0000-0000');
    $('.jQueryMask-phone_us').mask('(000) 000-0000');
    $('.jQueryMask-mixed').mask('AAA 000-S0S');
    $('.jQueryMask-ip_address').mask('099.099.099.099');
    $('.jQueryMask-rg').mask('99.999.999-9');
    $('.jQueryMask-percent').mask('##0,00%', {
        reverse: true
    });

    $('.jQueryMask-clear-if-not-match').mask("00/00/0000", {
        clearIfNotMatch: true
    });
    $('.jQueryMask-placeholder').mask("00/00/0000", {
        placeholder: "__/__/____"
    });
    $('.jQueryMask-fallback').mask("00r00r0000", {
        translation: {
            'r': {
                pattern: /[\/]/,
                fallback: '/'
            },
            placeholder: "__/__/____"
        }
    });

    $('.jQueryMask-selectonfocus').mask("00/00/0000", {
        selectOnFocus: true
    });

    $('.jQueryMask-cep_with_callback').mask('00000-000', {
        onComplete: function(cep) {
            console.log('Mask is done!:', cep);
        },
        onKeyPress: function(cep, event, currentField, options) {
            console.log('An key was pressed!:', cep, ' event: ', event, 'currentField: ', currentField.attr('class'), ' options: ', options);
        },
        onInvalid: function(val, e, field, invalid, options) {
            var error = invalid[0];
            console.log("Digit: ", error.v, " is invalid for the position: ", error.p, ". We expect something like: ", error.e);
        }
    });

    $('.jQueryMask-crazy_cep').mask('00000-000', {
        onKeyPress: function(cep, e, field, options) {
            var masks = ['00000-000', '0-00-00-00'];
            mask = (cep.length > 7) ? masks[1] : masks[0];
            $('.crazy_cep').mask(mask, options);
        }
    });

    $('.jQueryMask-cnpj').mask('00.000.000/0000-00', {
        reverse: true
    });
    $('.jQueryMask-cpf').mask('000.000.000-00', {
        reverse: true
    });
    $('.jQueryMask-money').mask('#.##0,00', {
        reverse: true
    });

    var SPMaskBehavior = function(val) {
            return val.replace(/\D/g, '').length === 11 ? '(00) 00000-0000' : '(00) 0000-00009';
        },
        spOptions = {
            onKeyPress: function(val, e, field, options) {
                field.mask(SPMaskBehavior.apply({}, arguments), options);
            }
        };

    $('.jQueryMask-sp_celphones').mask(SPMaskBehavior, spOptions);

    $(".jQueryMask-bt-mask-it").click(function() {
        $(".jQueryMask-mask-on-div").mask("000.000.000-00");
        $(".jQueryMask-mask-on-div").fadeOut(500).fadeIn(500)
    })

    // $('pre').each(function(i, e) {
    //     hljs.highlightBlock(e)
    // });
});


